var rrColor={};

rrColor.Color=function(){
	this.r=255;
	this.g=0;
	this.b=0;
};
rrColor.Color.prototype.set=function(r,g,b,a){
	if(r!=undefined && r!=null){
		var rr=this._checkValComponent(r);
		if(rr!=null){
			this.r=rr;
		}
	}
	if(g!=undefined && g!=null){
		var gg=this._checkValComponent(g);
		if(gg!=null){
			this.g=gg;
		}
	}
	if(b!=undefined && b!=null){
		var bb=this._checkValComponent(b);
		if(bb!=null){
			this.b=bb;
		}
	}
	this.setTransparency(a);
	this.h=-1;
	this.s=-1;
	this._s=-1;
	this._w=-1;
	this._b=-1;
};
rrColor.Color.prototype.setTransparency=function(a){
	if(a!=undefined && a!=null){
		var aa=this._checkValA(a);
		if(aa!=null){
			this.a=aa;
		}
	}
};
rrColor.Color.prototype._checkValComponent=function(e){
	if(e!=undefined && e!=null){
		var ee=parseInt(''+e);
		if(ee+''!='NaN'){
			if(ee<0){
				ee=0;
			}else if(ee>255){
				ee=255;
			}
			return ee;
		}
	}
	return null;
};
rrColor.Color.prototype._checkValA=function(e){
	if(e!=undefined && e!=null){
		var ee=parseFloat(''+e);
		if(ee+''!='NaN'){
			if(ee<0){
				ee=0;
			}else if(ee>1){
				ee=1;
			}/*else{
				ee=(Math.round(ee*1000))/1000;
			}*/
			return ee;
		}
	}
	return null;
};
rrColor.Color.prototype.FromHwb=function(hue, white, black) {
  var  rgbArr = [];
  var rgb=new rrColor.Color();
  var _hue = 0+hue;
  var _white = white/100;
  var _black = black/100;
	if(_hue>=360)_hue-=360;
  rgb.FromHsl(_hue, 100, 50);
  rgbArr[0] = rgb.r / 255;
  rgbArr[1] = rgb.g / 255;
  rgbArr[2] = rgb.b / 255;
  var tot = _white + _black;
  if (tot > 1) {
    _white = Number((_white / tot).toFixed(2));
    _black = Number((_black / tot).toFixed(2));
  }
  for (var i = 0; i < 3; i++) {
    rgbArr[i] *= (1 - (_white) - (_black));
    rgbArr[i] += (_white);
    rgbArr[i] = Number(rgbArr[i] * 255);
  }
  this.set(rgbArr[0],rgbArr[1],rgbArr[2]);
	this.h=hue;
	this._w=white;
	this._b=black;
};
rrColor.Color.prototype.FromHsv=function(hue, sat, value) {
	var _sat=sat/100;
	var _value=value/100;
	var _white=(1-_sat)*_value;
	var _black=1-_value;
	this.FromHwb(0+hue,_white*100,_black*100);
	this._w=-1;
	this._b=-1;
	this.h=hue;
	this._s=_sat;
}
rrColor.Color.prototype.FromHsl=function(hue, sat, light) {
  var t1=0;
  var t2=0;
  var _sat=sat/100;
  var _light=light/100;
  var _hue = 0+hue
	if(_hue>=360)_hue-=360;
  _hue = _hue / 60;
  if ( _light <= 0.5 ) {
    t2 = _light * (_sat + 1);
  } else {
    t2 = _light + _sat - (_light * _sat);
  }
  t1 = _light * 2 - t2;
  var r = this._hueToRgbComponent(t1, t2, _hue + 2) * 255;
  var g = this._hueToRgbComponent(t1, t2, _hue) * 255;
  var b = this._hueToRgbComponent(t1, t2, _hue - 2) * 255;
  this.set(r,g,b);
	this.h=hue;
	this.s=_sat;
};
rrColor.Color.prototype.FromCmyk=function(c, m, y, k) {
  var r = 255 - ((Math.min(1, c * (1 - k) + k)) * 255);
  var g = 255 - ((Math.min(1, m * (1 - k) + k)) * 255);
  var b = 255 - ((Math.min(1, y * (1 - k) + k)) * 255);
  this.set(r,g,b);
}
rrColor.Color.prototype._hueToRgbComponent=function(t1, t2, hue60) {
  if (hue60 < 0) hue60 += 6;
  if (hue60 >= 6) hue60 -= 6;
  if (hue60 < 1) return (t2 - t1) * hue60 + t1;
  else if(hue60 < 3) return t2;
  else if(hue60 < 4) return (t2 - t1) * (4 - hue60) + t1;
  else return t1;
};
rrColor.Color.prototype.ToHsl=function() {
  var h=0;
  var l=0;
  var s=0;
  
  var r = this.r / 255;
  var g = this.g / 255;
  var b = this.b / 255;
  var max = Math.max(r, g, b), min = Math.min(r, g, b);

  var d = max - min;

  if (max == min) {
    h = 0; // achromatic
  } else {
    switch (max) {
      case r: h = (g - b) / d + (g < b ? 6 : 0); break;
      case g: h = (b - r) / d + 2; break;
      case b: h = (r - g) / d + 4; break;
    }

    h /= 6;
  }
h=Math.round(h*360);
 /* var rgb = [this.r / 255, this.g / 255, this.b / 255];
  var min = rgb[0];
  var max = rgb[0];
  var maxcolor=0;
  for (var i = 0; i < rgb.length - 1; i++) {
    if (rgb[i + 1] <= min) {min = rgb[i + 1];}
    if (rgb[i + 1] >= max) {max = rgb[i + 1];maxcolor = i + 1;}
  }
  if(max - min!=0){
	  if (maxcolor == 0) {
		h = (rgb[1] - rgb[2]) / (max - min);
	  }
	  if (maxcolor == 1) {
		h = 2 + (rgb[2] - rgb[0]) / (max - min);
	  }
	  if (maxcolor == 2) {
		h = 4 + (rgb[0] - rgb[1]) / (max - min);
	  }
  }else{
	  h=0
  }
  if (isNaN(h)) {h = 0;}
  h = h * 60;*/
  if (h < 0) {h = h + 360; }
  if (h > 360) {h = h - 360; }
  l = (min + max) / 2;
  if (min == max) {
    s = 0;
  } else {
    if (l < 0.5) {
      s = (max - min) / (max + min);
    } else {
      s =((2 - max - min)!=0)? (max - min) / (2 - max - min):1;
    }
  }
  s = s;
  if(this.s>=0)s=this.s;
  if(this.h>=0){
	h=this.h;
  }
  return {h : h, s : Math.round(s*100), l : Math.round(l*100)};
};
rrColor.Color.prototype.ToHsv=function() {
	
  var r = this.r / 255;
  var g = this.g / 255;
  var b = this.b / 255;

  var max = Math.max(r, g, b), min = Math.min(r, g, b);
  var h, s, v = max;

  var d = max - min;
  s = max == 0 ? 0 : d / max;

  if (max == min) {
    h = 0; // achromatic
  } else {
    switch (max) {
      case r: h = (g - b) / d + (g < b ? 6 : 0); break;
      case g: h = (b - r) / d + 2; break;
      case b: h = (r - g) / d + 4; break;
    }

    h /= 6;
  }
h=Math.round(h*360);
	if(this.h>=0){
		h=this.h;
	}
	if(this._s>=0){
		s=this._s;
	}
  return {h : h, s : Math.round(100*s), v : Math.round(100*v)};
};

rrColor.Color.prototype.ToHwb=function() {
  var h=0;
  var w=0;
  var bb=0;
  var r = this.r / 255;
  var g = this.g / 255;
  var b = this.b / 255;
  var max = Math.max(r, g, b);
  var min = Math.min(r, g, b);
  var chroma = max - min;
  if (chroma == 0) {
    h = 0;
  } else if (r == max) {
    h = (((g - b) / chroma) % 6) * 360;
  } else if (g == max) {
    h = ((((b - r) / chroma) + 2) % 6) * 360;
  } else {
    h = ((((r - g) / chroma) + 4) % 6) * 360;
  }
  w = min;
  bb = 1 - max;
  if(this.h>=0){
	h=this.h;
  }
  if(this._w>=0)w=this._w;
  if(this._b>=0)b=this._b;
  return {h : h, w : Math.round(w*100), b : Math.round(bb*100)};
};
rrColor.Color.prototype.ToCmyk=function() {
  var c=0;
  var m=0;
  var y=0;
  var k=0;
  var r = this.r / 255;
  var g = this.g / 255;
  var b = this.b / 255;
  var max = Math.max(r, g, b);
  var k = 1 - max;
  if (k == 1) {
    c = 0;
    m = 0;
    y = 0;
  } else {
    c = (1 - r - k) / (1 - k);
    m = (1 - g - k) / (1 - k);
    y = (1 - b - k) / (1 - k);
  }
  return {c : c, m : m, y : y, k : k};
};
rrColor.Color.prototype._ComponentHex=function(cc) {
  var hex = cc.toString(16);
  while (hex.length < 2) {hex = "0" + hex; }
  return hex;
};
rrColor.Color.prototype.clone=function() {
	var colOut=new rrColor.Color();
	colOut.copy(this);
	return colOut;
};
rrColor.Color.prototype.copy=function(colorOrigin) {
	if(colorOrigin!=undefined && colorOrigin!=null && colorOrigin!=this){
		this.h=-1;
		this.s=-1;
		this.a=1;
		this._s=-1;
		this._w=-1;
		this._b=-1;
		if(colorOrigin.r!=undefined && colorOrigin.r!=null)
			this.r=colorOrigin.r;
		if(colorOrigin.g!=undefined && colorOrigin.g!=null)
			this.g=colorOrigin.g;
		if(colorOrigin.b!=undefined && colorOrigin.b!=null)
			this.b=colorOrigin.b;
		if(colorOrigin.a!=undefined && colorOrigin.a!=null)
			this.a=colorOrigin.a;
		if(colorOrigin.h!=undefined && colorOrigin.h!=null)
			this.h=colorOrigin.h;
		if(colorOrigin.s!=undefined && colorOrigin.s!=null)
			this.s=colorOrigin.s;
		if(colorOrigin._s!=undefined && colorOrigin._s!=null)
			this._s=colorOrigin._s;
		if(colorOrigin._w!=undefined && colorOrigin._w!=null)
			this._w=colorOrigin._w;
		if(colorOrigin._b!=undefined && colorOrigin._b!=null)
			this._b=colorOrigin._b;
	}
};

rrColor.Color.prototype.equal=function(c){
	if(c!=undefined && c!=null)
	if(c instanceof rrColor.Color){
		if(this.r==c.r && this.g==c.g && this.b==c.b && this.a==c.a && this.h==c.h && this.s==c.s && this._s==c._s && this._w==c._w && this._b==c._b )
			return true;
	}
	return false;
};
rrColor.Color.prototype.equalEasy=function(c){
	if(c!=undefined && c!=null)
	if(("r" in c) && ("g" in c) && ("b" in c)){
		if(this.r==c.r && this.g==c.g && this.b==c.b){
			if(!("a" in c) || c.a==this.a)
			return true;
		}
	}
	return false;
};

rrColor.Color.prototype.r=255;
rrColor.Color.prototype.g=0;
rrColor.Color.prototype.b=0;
rrColor.Color.prototype.a=1;
rrColor.Color.prototype.h=-1;
rrColor.Color.prototype.s=-1;
rrColor.Color.prototype._s=-1;
rrColor.Color.prototype._w=-1;
rrColor.Color.prototype._b=-1;

