rrColor.NumericSpinRGB=function(elem,initColor,useTransparency,compact){
		
	var ctrl=document.createElement('div');
	ctrl.classList.add("_main_box_NumericSpinRGB_Color");
	if(compact!=undefined && compact!=null && compact==true)
		ctrl.classList.add("_compact_NumericSpinRGB_Color");
	
rrColor.createLabelColor(ctrl,"R",compact,"red");
var numR=rrColor.createUINumericSpin(ctrl,255,compact);
rrColor.createLabelColor(ctrl,"G",compact,"green");
var numG=rrColor.createUINumericSpin(ctrl,0,compact);
rrColor.createLabelColor(ctrl,"B",compact,"blue");
var numB=rrColor.createUINumericSpin(ctrl,0,compact);
var ctrlA=document.createElement('div');
rrColor.createLabelColor(ctrlA,"A",compact);
var numA=rrColor.createUINumericSpin(ctrlA,100,compact,100);
	
	ctrlA.classList.add("_transparent_NumericSpinRGB_Color");
	
	ctrl.appendChild(ctrlA);
	elem.appendChild(ctrl);

	if(useTransparency!=undefined && useTransparency!=null && useTransparency==true)
		ctrl.classList.add("_use_transparency_NumericSpinRGB_Color");
	
	this.useTransparency=function(use){
		if(use!=undefined && use!=null && use==true){
			ctrlPBack.classList.add("_use_transparency_NumericSpinRGB_Color");
		}else{
			ctrlPBack.classList.remove("_use_transparency_NumericSpinRGB_Color");
		}
	};
	var __colorIntern=new rrColor.Color();
	__colorIntern.copy(initColor);
	
	var propag=true;
	var self=this;
	var valChanged=function(){
		if(propag && self.onValChange!=null && typeof(self.onValChange)=='function' ){
			self.onValChange(__colorIntern);
		}
	};		
	
	this.getValue=function(){
		var col=new rrColor.Color(); col.copy(__colorIntern);
		return col;
	};
	this.setValue=function(color,propagation){
		if(color!=undefined && color!=null){
			propag=false;
			var needUpd=false;
			if(numG.getValue()!=color.g){
				numG.setValue(color.g);
				needUpd=true;
			}
			if(numB.getValue()!=color.b){
				numB.setValue(color.b);
				needUpd=true;
			}
			if(numR.getValue()!=color.r){
				numR.setValue(color.r);
				needUpd=true;
			}
			if(numA.getValue()!=color.a*100){
				numA.setValue(color.a*100);
				needUpd=true;
			}
			propag=(propagation!=undefined && propagation!=null && propagation==false)?false:true;
			if(needUpd)
				valChanged();
			propag=true;
		}
	};
	
	this.setValue(__colorIntern,false);
	
	numR.onValueChanged=function(v){
		if(__colorIntern.r!=v){
			__colorIntern.r=v;
			valChanged();
		}
	};
	numG.onValueChanged=function(v){
		if(__colorIntern.g!=v){
			__colorIntern.g=v;
			valChanged();
		}
	};
	numB.onValueChanged=function(v){
		if(__colorIntern.b!=v){
			__colorIntern.b=v;
			valChanged();
		}
	};
	numA.onValueChanged=function(v){
		if(__colorIntern.a!=v/100){
		__colorIntern.a=v/100;
		valChanged();
		}
	};
		
};
