								var dx=x-xStart;
								var dy=yStart-y;
								var dex=x-xEnd;
								var dey=yEnd-y;
								var dP=ddx*ddx+ddy*ddy;
								var ds=dx*dx+dy*dy;
								var de=dex*dex+dey*dey;
								
								var fact=0;
								
										
								if(yStart==yEnd && ddx!=0){
									fact=dx/ddx;
								if(fact<0)fact=0;
								}else if(xStart==xEnd && ddy!=0){
									fact=dy/ddy;
								if(fact<0)fact=0;
								}else if(ds-de>dP){
											fact=1;
										}else if(de-ds>dP){
											fact=0;
										}else if(ds+de!=0){
										var defs=Math.sqrt(ds);
										var defe=Math.sqrt(de);
											fact=defs/(defs+defe);
										}
										
								if(fact>1)fact=1;
								return fact;
								
						return -1;
